public class Solution04_gpt {
    public int mySqrt(int x) {
        if (x == 0 || x == 1) {
            return x;
        }

        int left = 1;
        int right = x;
        int result = 0;

        while (left <= right) {
            int mid = (left + right) / 2;

            if (mid * mid == x) {
                return mid;
            } else if (mid <= x / mid) {
                left = mid + 1;
                result = mid;
            } else {
                right = mid - 1;
            }
        }

        return result;
    }
}

public class Solution05_gpt {
    public int climbStairs(int n) {
        if (n == 1 || n == 2) {
            return n;
        }

        int prevPrev = 1;
        int prev = 2;
        int current = 0;

        for (int i = 3; i <= n; i++) {
            current = prevPrev + prev;
            prevPrev = prev;
            prev = current;
        }

        return current;
    }
}

